CREATE TABLE IF NOT EXISTS `listHouses` (
  `SellerSSN` int default NULL,
  `SellerName` varchar(255) default NULL,
  `SellerPhoneNumber` varchar(100) default NULL,
  `HouseID` varchar(255),
  `NumBeds` int default NULL,
  `NumBaths` int default NULL,
  `SaleID` varchar(36) NOT NULL,
  `HouseZipCode` int default NULL,
  `ListingPrice` int default NULL,
  `AgentID` int default NULL,
  `AgentName` varchar(255) default NULL,
  `AgentOfficeID` int default NULL,
  `ListingStatus` varchar default NULL,
  `id` INT,
  PRIMARY KEY (`HouseID`));

CREATE TABLE IF NOT EXISTS "listHousesDate"(
  `MonthListed` varchar default NULL,
  `YearListed` INT default NULL,
  `id` INT
  );
CREATE TABLE  IF NOT EXISTS `BuyersInformation` (
  `BuyerID` int,
  `BuyerName` varchar(55) default NULL,
  `MonthBought` varchar(55) default NULL,
  `YearBought` int default NULL,
  `BuyPrice` int default NULL,
  `id` int,
  `ListingStatus` varchar(55) default NULL,
  PRIMARY KEY (`id`)
);
CREATE TABLE IF NOT EXISTS `offices` (
  `OfficeID` mediumint default NULL,
  `OfficeName` varchar(255),
  `OfficeZipCode` int,
  PRIMARY KEY (`OfficeID`)
);

CREATE TABLE IF NOT EXISTS `BuyerPhones` (
  `BuyerPhoneNumber` varchar(100) default NULL,
  `id` int,
  PRIMARY KEY (`id`)
);


